function Map(props) {
    const {setMap} = props;

    function handleValue(e) {
        const value = e.target.value;
        console.log(value);
        setMap(value)
    }
    return (
        <div>
            <select onChange={handleValue} >
                <option value='map1'>map1</option>
                <option value='map2'>map2</option>
            </select>
        </div>
    );  
}

export default Map;
